import React from "react";
import './MainSocialLogin.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGoogle, faApple, faFacebook } from '@fortawesome/free-brands-svg-icons';

const MainSocialLogin = () => {
    return (
        <div className="OAuthBox">
            <div className="mainText">Or continue with</div>
            <div className="IconsBox">
                <button className="GBtn">
                    <FontAwesomeIcon icon={faGoogle} size="2x" className="icon" />
                </button>
                <button className="ABtn">
                    <FontAwesomeIcon icon={faApple} size="2x" className="icon" />
                </button>
                <button className="FBtn">
                    <FontAwesomeIcon icon={faFacebook} size="2x" className="icon" />
                </button>
            </div>
            <div className="RegisterBox">
                <div className="RegisterText">Don't have an account?</div>
                <button className="RegisterBtn">
                    <span className="RegisterBtnText">Register now</span>
                </button>
            </div>
        </div>
    );
};

export default MainSocialLogin;
